<div class="toTopNav">^</div>
<script>
    $(document).ready(function () {
        /* Create button to scroll to top of page */
        $("html, body").animate({
            scrollTop: 0
        }, "slow");
        $('.toTopNav').css({
            cursor: 'pointer',
            position: 'fixed',
            width: '35px',
            height: '35px',
            zIndex: '1400',
            backgroundColor: '#C0C0C0',
            textAlign: 'center',
            fontSize: '28px',
            color: '#FFFFFF',
            top: $(document).height() - Number(50),
            left: $(document).width() - Number(70)
        });
        /* Scroll to the top of page */
        $('.toTopNav').click(function () {
            $('html, body').animate({
                scrollTop: 0
            }, 'fast');
            return false;
        });
        /* Scroll to the top of page */
        $('.toTopNav').bind('mouseover', function () {
            $(this).css({
                opacity: '0.8'
            });
        });
        $('.toTopNav').bind('mouseout', function () {
            $(this).css({
                opacity: '1'
            });
        });
        $(window).load(function () {
            $('#preloader').fadeOut('slow', function () {
                $(this).remove();
            });
        });
		window.setTimeout(function(){
            $('#preloader').fadeOut('slow', function () {
                $(this).remove();
            });
		},1000);
        $('body').css("overflow-x", "hidden");
    });
</script>
